webpackJsonp([0x62cebbe44991],{2458:function(a,e){a.exports={data:{markdownRemark:{html:'<p><strong>üå° 24 ¬∞ C ‚òÅ</strong></p>\n<p>Today I participated in a volunteer recycling sponsored by the kids\' association. <a href="../05/20-diary.md">Is</a> it the <a href="../05/20-diary.md">first time in half a year</a> ?</p>\n<p>We help you load heavy old newspapers, old magazines, advertisement papers, and a large amount of waste items such as bottles and cans on trucks. My gloves were doing, but my hands hurt after all, and I am very tired. The reward for this time was ice cream.</p>\n<p>In the afternoon I played with NES who came to play with NES. In addition, since H came to visit, <a href="../09/24-diary.md">I</a> went to play in the park of Nishi - Kasado I found in <a href="../09/24-diary.md">the mapping</a> of the <a href="../09/24-diary.md">other day</a> .</p>',frontmatter:{cover:null,date:"1990-10-14T21:00:00+09:00",strDate:"1990/10/14",title:"diary"}}},pathContext:{path:"/en/blog/1990/10/14-diary/",langKey:"en"}}}});
